  return (
    <footer className="footer mt-auto py-3 bg-light">
      <div className="container d-flex justify-content-center" style={{position: 'fixed', bottom: 0, textAlign:'center'}}>
        <span className="text-muted" >
           &copy; {new Date().getFullYear()} Werty
